import React from 'react';

import Button from '@material-ui/core/Button';
import Grid from '@material-ui/core/Grid';
import FreeBreakfastIcon from '@material-ui/icons/FreeBreakfast';
import KeyboardIcon from '@material-ui/icons/Keyboard';

const FirstThingYouFace = props => {
	return (
		<Grid
			container
			className='container'
			direction='column'
			alignItems='center'
			justify='center'
		>
			<Grid item xs={6} className='border'>
				<h1 className='heading'>تیز سفارش بده. تیز تحویل بگیر.</h1>
			</Grid>
			<Grid item xs={6} className='border'>
				<Button
					variant='contained'
					startIcon={<KeyboardIcon />}
					color='primary'
					size='large'
					style={{ marginRight: '10px' }}
				>
					انجام پروژه
				</Button>
				<Button
					variant='contained'
					startIcon={<FreeBreakfastIcon />}
					color='primary'
					size='large'
				>
					سفارش تایپ
				</Button>
			</Grid>
		</Grid>
	);
};

export default FirstThingYouFace;
